import './CinemaCard.css';
import React from 'react';
import Screening from './Screening.jsx';

const CinemaCard = ({ sede, funciones }) => {
    return (
        <div className='mx-3'>
            <div className="card">
                <button className="card-header" type="button" data-bs-toggle="collapse" data-bs-target={"#"+sede} aria-expanded="false" aria-controls="collapse">
                    {sede}
                </button>
                <div className="card-body collapse" id={"#"+sede}>
                    {Object.keys(funciones).map((key) => {
                        <Screening funcion={funciones[key]}></Screening>
                    })}
                </div>
            </div>
        </div>
    );
}

export default CinemaCard;
